import React from 'react';

const containerStyle = {
  display: 'flex',
  flexDirection: 'column',
  height: '100vh',
};

const headerStyle = {
  marginTop: 100,
  fontSize: 30,
  color: '#000000',
  marginBottom: 50,
  textAlign: 'center',
};

export default class GoogleCalendarInstructions extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {

    return (
    <div style={containerStyle}>
      <div style={headerStyle}>
        Import events to Google Calendar
      </div>
    </div>
    );
  }
}
